// Expects an array with elements of a single type, doesn't handle mixed-type arrays
function sumElements(elements: number[]): number {
  // Assumes all elements are numbers
  elements.forEach((element) => {
    if (typeof element !== 'number') {
      throw new Error('All elements must be numbers')
    }
  })
  return elements.reduce((acc, val) => acc + val, 0)
}

